import React from 'react'

import { Nav } from '../Componets/Navbar/Nav'
import { Footer } from '../Componets/Footer/Footer'
import { Cervices } from '../Componets/Services/Cervices'
import { Mark1 } from '../Componets/Marketing/Mark1'


export const Mark = () => {
    return (
        <div><Nav></Nav>
        <Cervices></Cervices>
        <Mark1></Mark1>
        <Footer></Footer></div>
      )
    }
